import React, { useState, useEffect } from "react";
import Navbar from "./components/Navbar";
import ComplaintForm from "./components/ComplaintForm";
import ComplaintTracker from "./components/ComplaintTracker";
import ComplaintHistory from "./components/ComplaintHistory";

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState("submit");
  const [stats, setStats] = useState({
    total_complaints: 0,
    new_complaints: 0,
    pending_complaints: 0,
    resolved_complaints: 0,
  });
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Load user data from localStorage or context
    const userData = localStorage.getItem("user");
    if (userData) {
      setUser(JSON.parse(userData));
    }

    // Fetch dashboard statistics
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      const response = await fetch("http://localhost:5000/dashboard/stats");
      const data = await response.json();

      if (data.success) {
        setStats(data.stats);
      }
    } catch (error) {
      console.error("Error fetching stats:", error);
    }
  };

  const renderTabContent = () => {
    switch (activeTab) {
      case "submit":
        return <ComplaintForm user={user} onComplaintSubmitted={fetchStats} />;
      case "track":
        return <ComplaintTracker user={user} />;
      case "history":
        return <ComplaintHistory user={user} />;
      default:
        return <ComplaintForm user={user} onComplaintSubmitted={fetchStats} />;
    }
  };

  return (
    <div className="dashboard-container">
      <Navbar user={user} />

      <div className="dashboard-content">
        <div className="dashboard-header">
          <h1>Welcome to ResolveIT Portal</h1>
          <p>Your complaints and feedback management system</p>
        </div>

        {/* Dashboard Stats */}
        <div className="stats-container">
          <div className="stat-card">
            <div className="stat-number">{stats.total_complaints || 0}</div>
            <div className="stat-label">Total Complaints</div>
          </div>
          <div className="stat-card">
            <div className="stat-number">{stats.new_complaints || 0}</div>
            <div className="stat-label">New</div>
          </div>
          <div className="stat-card">
            <div className="stat-number">{stats.pending_complaints || 0}</div>
            <div className="stat-label">Pending</div>
          </div>
          <div className="stat-card">
            <div className="stat-number">{stats.resolved_complaints || 0}</div>
            <div className="stat-label">Resolved</div>
          </div>
        </div>

        {/* Tab Navigation */}
        <div className="tab-navigation">
          <button
            className={`tab-btn ${activeTab === "submit" ? "active" : ""}`}
            onClick={() => setActiveTab("submit")}
          >
            Submit Complaint
          </button>
          <button
            className={`tab-btn ${activeTab === "track" ? "active" : ""}`}
            onClick={() => setActiveTab("track")}
          >
            Track Status
          </button>
          <button
            className={`tab-btn ${activeTab === "history" ? "active" : ""}`}
            onClick={() => setActiveTab("history")}
          >
            My Complaints
          </button>
        </div>

        {/* Tab Content */}
        <div className="dashboard-main">{renderTabContent()}</div>
      </div>
    </div>
  );
};

export default Dashboard;
